//const querystring = require('querystring');
class DataService {
  create(data) {
    //return http.get("/simulado", data);
    return http.post("/simulado", qs.stringify(data)).then(response => {
      console.log(response.data);
             })
          .catch(error => {
          console.log(error.message);
  });
  }

  retrieve(){
